style.css:
@-moz-document domain("thefitness.wiki") {
body {
    color: #eee;
    background-color: #262626;
}

.site-title a {

    color: #eee;
}
.site-description {
    color: #eee;
}

#ez-toc-container.ez-toc-light-blue {
    background: #444444;
    border: none;
}

#ez-toc-container a {
    color: #eee;
}

.site .comments-area > :last-child, .site #jp-post-flair > :last-child, .site .taxonomy-description > :last-child, .site .comment-content > :last-child, .site .entry-footer > :last-child, .site .entry-caption > :last-child, .site .entry-header > :last-child, .site .entry-content > :last-child, .site .entry-summary > :last-child, .site .entry-meta > :last-child, .site .page-content > :last-child, .site .page-header > :last-child, .site .widget > :last-child, .site blockquote > :last-child {   
    color: #eee;
}

.site .comments-area > :first-child, .site #jp-post-flair > :first-child, .site .taxonomy-description > :first-child, .site .comment-content > :first-child, .site .entry-footer > :first-child, .site .entry-caption > :first-child, .site .entry-header > :first-child, .site .entry-content > :first-child, .site .entry-summary > :first-child, .site .entry-meta > :first-child, .site .page-content > :first-child, .site .page-header > :first-child, .site .widget > :first-child, .site blockquote > :first-child {    
    color: #eee;
}

input[type="text"], input[type="password"], input[type="email"], input[type="search"], input[type="url"] {
    background-color: #333;
    color: #eee;
}

h1, h2, h3, h4, h5, h6 {
    color: #eee;
}
}
